  const AssignLecturerModal = ({ show, onHide, course, onAssignLecturer }) => {
    const [formData, setFormData] = useState({
        lecturer_id: '',
        class_name: '',
        venue: '',
        scheduled_time: '08:00',
        total_students: 25
    });
    const [lecturers, setLecturers] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');

    useEffect(() => {
        if (show && course) {
            fetchLecturers();
            // Generate default class name
            setFormData(prev => ({
                ...prev,
                class_name: `${course.course_code}-01`
            }));
        }
    }, [show, course]);

    const fetchLecturers = async () => {
        try {
            console.log('Fetching lecturers...');
            const lecturersData = await courseManagementService.getLecturers();
            console.log('Lecturers data:', lecturersData);
            setLecturers(lecturersData);
            setError('');
        } catch (error) {
            console.error('Error fetching lecturers:', error);
            setError('Failed to load lecturers');
            // Fallback to empty array
            setLecturers([]);
        }
    };

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        try {
            await onAssignLecturer(course.id, formData);
            setFormData({
                lecturer_id: '',
                class_name: '',
                venue: '',
                scheduled_time: '08:00',
                total_students: 25
            });
            onHide();
        } catch (error) {
            setError(error.response?.data?.error || 'Failed to assign lecturer');
        } finally {
            setLoading(false);
        }
    };

    if (!show) return null;

    return (
        <div className="modal show" style={{ display: 'block', backgroundColor: 'rgba(0,0,0,0.5)' }}>
            <div className="modal-dialog modal-lg">
                <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title">Assign Lecturer to {course?.course_code}</h5>
                        <button type="button" className="btn-close" onClick={onHide}></button>
                    </div>
                    <form onSubmit={handleSubmit}>
                        <div className="modal-body">
                            {error && <div className="alert alert-danger">{error}</div>}
                            
                            <div className="mb-3">
                                <label className="form-label">Lecturer *</label>
                                <select
                                    className="form-select"
                                    name="lecturer_id"
                                    value={formData.lecturer_id}
                                    onChange={handleChange}
                                    required
                                >
                                    <option value="">Select Lecturer</option>
                                    {lecturers.map(lecturer => (
                                        <option key={lecturer.id} value={lecturer.id}>
                                            {lecturer.name} ({lecturer.email})
                                        </option>
                                    ))}
                                </select>
                                {lecturers.length === 0 && (
                                    <div className="text-warning mt-1">
                                        No lecturers found. Make sure lecturers are registered with the "lecturer" role.
                                    </div>
                                )}
                            </div>

                            <div className="row">
                                <div className="col-md-6">
                                    <div className="mb-3">
                                        <label className="form-label">Class Name *</label>
                                        <input
                                            type="text"
                                            className="form-control"
                                            name="class_name"
                                            value={formData.class_name}
                                            onChange={handleChange}
                                            placeholder="e.g., DIT101-01"
                                            required
                                        />
                                    </div>
                                </div>
                                <div className="col-md-6">
                                    <div className="mb-3">
                                        <label className="form-label">Total Students</label>
                                        <input
                                            type="number"
                                            className="form-control"
                                            name="total_students"
                                            value={formData.total_students}
                                            onChange={handleChange}
                                            min="0"
                                            max="100"
                                        />
                                    </div>
                                </div>
                            </div>

                            <div className="row">
                                <div className="col-md-6">
                                    <div className="mb-3">
                                        <label className="form-label">Venue</label>
                                        <input
                                            type="text"
                                            className="form-control"
                                            name="venue"
                                            value={formData.venue}
                                            onChange={handleChange}
                                            placeholder="e.g., ICT Lab 1"
                                        />
                                    </div>
                                </div>
                                <div className="col-md-6">
                                    <div className="mb-3">
                                        <label className="form-label">Scheduled Time</label>
                                        <input
                                            type="time"
                                            className="form-control"
                                            name="scheduled_time"
                                            value={formData.scheduled_time}
                                            onChange={handleChange}
                                        />
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="modal-footer">
                            <button type="button" className="btn btn-secondary" onClick={onHide}>
                                Cancel
                            </button>
                            <button 
                                type="submit" 
                                className="btn btn-success" 
                                disabled={loading || !formData.lecturer_id || !formData.class_name}
                            >
                                {loading ? 'Assigning...' : 'Assign Lecturer'}
                            </button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
  };
